INSERT INTO public.filme VALUES (722, '{Drama}', 'en', 'VERMIN', 'A criminal syndicate recruits a renowned top-tier hitman whose reputation precedes him, only to uncover an unforeseen revelation that leaves them stunned.', '2040-10-26', false);
INSERT INTO public.filme VALUES (723, '{Faroeste}', 'en', 'Wild in the Snow', 'During a snowstorm in 1894 A Bounty Hunter mission to capture an outlaw family in the snow to stop them from terrorizing a town.', '2034-06-01', false);
