INSERT INTO public.filme VALUES (951, '{Animação}', 'en', 'On The Edge: Donnie Dares!', 'Lots of people have never heard of these six endangered animals: The Solenodon, the Kakapo, the Pangolin, the Aye-Aye, the greater Funnel-eared Bat and the Purple Frog. But soon everyone is going to know everything about them. This team of weird and wonderful animals takes fate into their own hands/paws to fight against extinction – so that one day their descendants will not have to live their lives forever ON THE EDGE.', '2026-12-31', false);
INSERT INTO public.filme VALUES (952, '{"Gênero Desconhecido"}', 'hi', 'Narayan Pustika 2 - Endless', 'This movie is the second part of the Narayana Pustika trilogy. In which there is a description of the troubles arising from the opening of the unimaginable door revealed by the great sages.', '2026-12-30', false);
